import React, { Component } from "react";
import { NavLink } from "react-router-dom";

import { Course } from "./Courses";
import { Toolbar, Button, Typography, Container } from "@material-ui/core";
import "react-owl-carousel2/lib/styles.css";

const CourseDetail = props => {
  return (
    <Container
    style={{
      display: "flex",
      borderRadius: "25px",
      flexWrap: "wrap",
      backgroundColor: "blue",
      height: "100%",
      padding: 0,
      marginTop: 20
    }}>
    <Container
      style={{
        backgroundColor: "red",
        width: "40%",
        float: "left"
      }}
    >
      <Course
        img={require("../images/image1.jpg")}
        title="Quantum Computers"
        desc="Ivan Cornejo"
        lessons="10 Lessons"
        button="website"
        color="#50C4EE"
        price="Rp 7,5JT"
      />
    </Container>
    <Container
      style={{
        backgroundColor: "green",
        width: "50%"
      }}
    ></Container>
  </Container>
  );
}

class CoursesDetail extends Component {
  render() {
    return (
      <Container
        style={{
          minHeight: "600px",
          margin: "0 auto",
          padding: 0,
          marginTop: "100px"
        }}
      >
        <Container
          fixed
          style={{
            margin: "20px",
            paddingTop: 20,
            height: "100%",
            borderRadius: "25px"
          }}
        >
          <Typography
            component="h1"
            align="center"
            variant="h1"
            style={{ textAlign: "center", color: "#EC9120" }}
          >
            Detail Paket Kursus
          </Typography>
          <Container
            fixed
            style={{ height: "90%", marginTop: 20, width: "100%" }}
          >
<CourseDetail/>
          </Container>
        </Container>
      </Container>
    );
  }
}

export default CoursesDetail;
